import { Link } from 'react-router-dom';
function Header(props) {
    return (
        <>
            <nav>
                <Link to="/">Home</Link>
                <Link to="/tourdetalis">TourDetails</Link>
                <Link to="/tours">Tours</Link>



            </nav>
        </>
    )
}

export default Header;
